Durant ce stage, j'ai développé un réseau de neurones récurrent en Python, pour effectuer du traçage de connaissances à partir des techniques d'apprentissage profond (Deep Knowledge Tracing ou DKT).

L'objectif de mon stage était de de mettre en place une solution qui améliore le DKT lorsqu’il y a présence de connaissances planchers/plafonds. Les connaissances planchers/plafonds sont les compétences respectivement difficiles/faciles à assimiler. Le problème avec ces connaissances ”extrêmes” est que les individus ayant bien répondu sur les connaissance planchers et mal répondu sur les connaissances plafonds seront sous-représentés dans le jeu de données. Étant donné que les techniques de machine learning (dont le DKT) se basent sur les données vues pour généraliser, ces solutions ne seront pas capables de bien généraliser sur les connaissances planchers/plafonds et donc feront un mauvais traçage de connaissances dans ces cas-là.

Pour pallier à ce problème, mon travail consistait à améliorer le DKT en 3 principales étapes :
• Identification des connaissances planchers/plafonds;
• Détermination des poids à attribuer pour pénaliser le modèle;
• Redéfinition de la fonction de perte en fonction de ces connaissances.

